import React, { useState, useRef } from "react";
import "./catalogue.scss";
import { HiOutlineChevronDown, HiOutlineChevronUp } from "react-icons/hi";
import { Product } from "./../../../data";
import * as Bs from "react-icons/bs";
import * as Fa from "react-icons/fa"
const Catalogue = () => {
  const [ischev, setisChev] = useState(false);
  const [nextlist,setNextlist]= useState(false);
  const open = useRef(null);
  const openNextlist = useRef(null);
  const handleChev = () => {
    setisChev(!ischev);
    if (!ischev) {
      open.current.classList.add("active");
    
    } else {
      open.current.classList.remove("active");
      openNextlist.current.classList.remove("active");
    
    }
  };
  const handleNextlist =()=>{
   setNextlist(!nextlist)
    if(!nextlist ){
      openNextlist.current.classList.add("active");
    }else{
      openNextlist.current.classList.remove("active");
    }
  }
  return (
    <div>
      <div className="c-catalogue">
        <div className="c-catalogue__left">
          <div className="filter">
            <div>
              <h2 className="filter__title">Category</h2>
            </div>
            <div>
              {ischev ? (
                <HiOutlineChevronUp
                className="filter__icon"
                onClick={handleChev}
              />
              ) : (
              <HiOutlineChevronDown
              className="filter__icon"
              onClick={handleChev}
            />
              )}
            </div>
          </div>
          <ul ref={open} className="list">
             {/* begin li-1 */}
            <li >
              <p > Apparel</p>
              <span className="count">9</span>
              {nextlist ? (
                 
                  <Fa.FaMinus
                  className="next-list"
                  onClick={handleNextlist}
                  />
                ): (
                  <Bs.BsPlusLg 
                  className="next-list"
                  onClick={handleNextlist}
                  />
                )
                 
                
              }
             
             
            </li>
            {/* start li-item-1*/ }
            <ul ref={openNextlist} className="list-item">
            <li>
            <p>Coats & jackets</p>
            <span className="count">3</span>
            </li>
            <li>
            <p>Dresses</p>
            <span className="count">1</span>
            </li>
            <li>
            <p>Knitwear</p>
            <span className="count">2</span>
            </li>
            <li>
            <p>Suits</p>
            <span className="count">4</span>
            </li>
            </ul>

              {/* end li-1 */}

                {/* start li-item-1*/ }
            <li>Home decor
            <span className="count">15</span>
            {nextlist ? (
               
                <Fa.FaMinus
                className="next-list"
                onClick={handleNextlist}
                />
              ): (
                <Bs.BsPlusLg 
                className="next-list"
                onClick={handleNextlist}
                />
              )
               
              
            }
            
            
            </li>
            <ul ref={openNextlist} className="list-item">
            <li>
            <p>Furniture</p>
            <span className="count">5</span>
            </li>
            <li>
            <p>Lighting</p>
            <span className="count">5</span>
            </li>
            <li>
            <p>Textile & decor</p>
            <span className="count">7</span>
            </li>
            </ul>
                 {/* end li-2 */}
                
                   {/*start li-3*/ }
            <li>Uncategorized  <span className="count">0</span></li>
             {/*end li-3*/ }
          </ul>
        </div>
        <div className="c-catalogue__right">
          <div className="c-catalogue-category">
            <span>Products</span>
          </div>
          <div className="c-catalogue__list">
            {Product.map((item) => (
              <div className="c-catalogue__item" key={item.id}>
                <div className="c-catalogue__content">
                  <figure className="c-catalogue__img">
                    <img src={item.firstimg} alt="no results" />
                  </figure>
                  <div className="c-catalogue__info">
                    <h4 className="c-catalogue__title">{item.title}</h4>
                    <p className="c-catalogue__price">${item.price}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};
export default Catalogue;
